  const irParaEnviar = () => {
    alert ("Parabéns, Inscrição concluída!")
    navigate ("/")
  }

    return(
      <div>
        InscrevaSe
        <hr/>
        <button onClick={() => navigate(-1)}>Voltar</button>
        <button onClick={irParaEnviar}>Enviar</button>
      </div>
    )
  }
